import React from 'react';
import {Route, Routes} from "react-router";
import "../index.css"
import Login from "../components/login";

const RoutesComponent = () => {

    return (
        <Routes>
            <Route path="/" element={<Login/>}/>
        </Routes>
    )
}

export default RoutesComponent;
